Within the context of VHDL, let's consider a symbol to be the identifier of a primary design unit . A primary design unit is a VHDL construct that exists at the global namespace. There are four primary design units: entity package configuration context Note: VHDL does support the concept of libraries , which can add 1 level of nested scope to a primary design unit, but this implementation only pushes the namespace clashing problem back 1 level. Within the context of Verilog/SystemVerilog, let's consider a symbol to be the identifier of a design element . A design element is a Verilog/SystemVerilog construct that exists at the global namespace. For Verilog, there is only two design elements (module and primitive), but for SystemVerilog, there are seven design elements: module program interface checker package primitive configuration In the following code, the symbol nand_g corresponds to a module. Filename: lab1/nand_g.v module nand_g ( input wire a, input wire b, output wire c
); Remember that this identifier could appear again at the same namespace level (since its global across all source code files), even if it has a different interface/implementation. Now imagine you are integrating HDL code from various existing ips. As you instantiate modules within larger modules, you realize there exists another module named nand_g in the hierarchy, but this one has a different behavior and port interface than the previously defined nand_g circuit from the "lab1/" directory. Filename: lab3/nand_g.v module nand_g ( input wire[3:0] x, input wire[3:0] y, output wire[3:0] z
); Since the current ip requires both code segments, then traditionally your EDA tool would complain to you and be unable to resolve which nand_g to be used where. It then falls on the developer to rename one of the modules where it is defined and everywhere it is referenced, which introduces additional overhead in time and possibilities for errors. This problem is solved with DST.

