Consider for an instant that our HDL only supports the nand keyword and is missing the other logic gates such as or, and, and xor. Recalling our basic knowledge of digital circuits, we know a NAND gate is a universal gate, so let's compose other gates using our newly created nand_gate entity. Create a new file for our next design unit to describe an AND gate. Filename: and_gate.vhd library ieee;
use ieee.std_logic_1164.all; entity and_gate is port( a, b : in std_logic; y : out std_logic );
end entity; architecture rtl of and_gate is
begin -- What to put here? end architecture; After some thinking, we realize we can use two NAND gates together to construct an AND gate. Let's use Orbit to help us integrate our nand_gate entity into the and_gate's architecture. $ orbit get nand_gate --component --signals --instance component nand_gate port( a : in std_logic; b : in std_logic; x : out std_logic );
end component; signal a : std_logic;
signal b : std_logic;
signal x : std_logic; uX : nand_gate port map( a => a, b => b, x => x ); With this single command, Orbit provided us with: the component declaration signals for the port interface an instantiation template Sweet! After some quick copy/pasting and signal renaming, we have our architecture described for an AND gate. Filename: and_gate.vhd library ieee;
use ieee.std_logic_1164.all; entity and_gate is port( a, b : in std_logic; y : out std_logic );
end entity; architecture rtl of and_gate is component nand_gate port( a : in std_logic; b : in std_logic; x : out std_logic ); end component; signal x : std_logic; begin u1 : nand_gate port map( a => a, b => b, x => x ); u2 : nand_gate port map( a => x, b => x, x => y ); end architecture; Let's make a quick check to verify our and_gate is using our nand_gate. $ orbit tree and_gate
└─ nand_gate Cool! We got a hierarchical view of our top-most design unit.

