Let's use the NAND gate we previously defined to construct a half adder circuit. $ orbit get --ip gates nand_gate --library --signals --instance library gates; signal a : std_logic;
signal b : std_logic;
signal x : std_logic; uX : entity gates.nand_gate port map( a => a, b => b, x => x ); A half adder can be constructed with 5 NAND gates. It's time to copy/paste our NAND gate instances into our new file "half_add.vhd". Filename: half_add.vhd library ieee;
use ieee.std_logic_1164.all; library gates; entity half_add is port( a, b : in std_logic; c, s : out std_logic );
end entity; architecture rtl of half_add is signal x4, x1, x2 : std_logic; begin -- 1st layer: This gate creates the first NAND intermediate output. u4 : entity gates.nand_gate port map( a => a, b => b, x => x4 ); -- 2nd layer: Perform NAND with input 'a' and the 1st layer's output. u1 : entity gates.nand_gate port map( a => a, b => x4, x => x1 ); -- 2nd layer: Perform NAND with input 'b' and the 1st layer's output. u2 : entity gates.nand_gate port map( a => x4, b => b, x => x2 ); -- 3rd layer: This gate produces the final sum signal ('a' XOR 'b'). u3 : entity gates.nand_gate port map( a => x1, b => x2, x => s ); -- 3rd layer: This gate produces the final carry out signal ('a' AND 'b'). u5 : entity gates.nand_gate port map( a => x4, b => x4, x => c ); end architecture; Let's inspect the design hierarchy to make sure our circuit and its components are identified by Orbit. $ orbit tree --format long half_add (half-add:0.1.0)
└─ nand_gate (gates:0.1.0) Finally, let's install this ip to the cache for future reuse as well. But before we can install any ip to our cache, an ip must have an up to date lockfile. Lockfiles are updated whenever a user calls orbit build or orbit test, but they can also be updated with the dedicated orbit lock command. Let's go ahead and generate the lockfile now. $ orbit lock Now we can safely install the ip to our catalog. $ orbit install Nice, now we have successfully reused designs across ips! However, maybe we should have designed all the logic gates in the gates ip...

