Our full adder circuit will be constructed of 2 half adders and an OR gate. Let's collect some HDL code snippets to use for our full adder circuit. $ orbit get half_add --ip half-add --library --instance library adding; uX : entity adding.half_add port map( a => a, b => b, c => c, s => s ); And let's get the code snippet for the OR gate as well. $ orbit get or_gate --ip gates:1.0.0 --library --instance library gates; uX : entity gates.or_gate port map( a => a, b => b, y => y ); Let's combine these circuits together into our new file for our full adder implementation. Filename: full_add.vhd library ieee;
use ieee.std_logic_1164.all; library adding;
library gates; entity full_add is port( a, b, cin : in std_logic; cout, s : out std_logic );
end entity; architecture rtl of full_add is signal c_ha0, s_ha0, c_ha1 : std_logic; begin -- 1st layer: Peform half of the addition operation. u_ha0 : entity adding.half_add port map( a => a, b => b, c => c_ha0, s => s_ha0 ); -- 2nd layer: Compute the final sum term. u_ha1 : entity adding.half_add port map( a => s_ha0, b => cin, c => c_ha1, s => s ); -- 3rd layer: Check both c terms from the half adders for the final cout term. u_or0 : entity gates.or_gate port map( a => c_ha0, b => c_ha1, y => cout ); end architecture; Our design heirarchy is getting more complex; we have full adders constructed of half adders and OR gates, half adders constructed of NAND gates, OR gates constructed of... uh-oh. More NAND gates. The NAND gate design unit used in the OR gates is different from NAND gates used in the half adders because they reside in different versions of the gates ip (essentially different ips). So did we just define an NAND gate entity twice with the same identifier? Yes, and thanks to Orbit, this situation is okay.
